import React from 'react';
import '../styles/Style.css';
import { GitHub, LinkedIn } from '@mui/icons-material';

const Footer = () => {
    return (
        <>
            <div className='footer'>
                &copy; {new Date().getFullYear()} All rights reserved.
            </div>
            <div>
                <a  className='hero-text' href='https://www.linkedin.com/in/siddharth-rupwate' className='social'><LinkedIn style={{ fontSize: "35px" }} /></a><a href='https://github.com/sidrupwate' className='social'><GitHub style={{ fontSize: "35px" }} /></a>
            </div>
        </>
    );
};

export default Footer;
